        "description": "üåè Get the exclusive NordVPN deal using this link https://nordvpn.com/beeyondideas üòé\nIt‚Äôs risk-free with NordVPN‚Äôs 30 day money back guarantee!\n\nWhat exactly is a tesseract? How could such a hyper-cubic, grid-like chamber becomes like a time machine? In this fun video, we'll explore the science behind #Interstellar #Tesseract\n\nIf you'd like to see more of this kind of video, consider supporting our work by becoming a member today!\nhttps://www.youtube.com/BeeyondIdeas/join\n\nFollow us on Instagram: https://www.instagram.com/beeyond.ideas/\n\nTimecode:\n0:00 Teaser\n0:53 Entering a black hole\n1:57 Accessing the fourth dimension\n4:49 The \"hidden\" layer\n6:43 Backward-in-time gravitational force\n8:01 Interstellar's plot: a paradox\n\n***\n\nScript:\n\nThe initial question to ask here is how Cooper got into the tesseract in the first place. From the film, we know that it is because he intends to lighten the Endurance‚Äôs load so that Dr. Brand can reach Edmunds‚Äô planet. So he flings himself and goes directly into the blackhole Gargantua.\n\nBut you might be asking: how could you enter a black hole and emerge alive at the other end? You may have heard that when someone are pulled into into a blackhole, their bodies could be stretched to the size of a spaghetti strand. In addition, if you approach the blackhole on a normal, perpedicular trajectory, your body will split into 2, 4, 8, 16, etc.\n\nHowever, because the film indicates that this is a spinning blackhole, this phenomenon does not occur. And in principle, you should be able to escape the bifurcation of your body by following a specific trajectory.\n\nNow.. as we are falling towards a black hole, time for us is gonna flow more slowly than the rest of the universe. And once Cooper is inside, time will stop flowing for him, according to an outside observer. When Cooper gets to a chamber, he realizes that this 4 dimensional hypercube is in fact, a manifestation of Murph‚Äôs actual bedroom at a particular moment of time.\n\n----\n\nFirst and foremost, we must state the obvious. Interstellar's science encompasses all four areas of physics: Newtonian, relativistic, quantum, and quantum gravity. In our current understanding of quantum gravity, our universe is a membrane, or as physicst would like to call it, a brane. This is the place where you, I, and everything else that exists or have existed, lay.\n\nThis brane resides in \"hyperspace,\" which is a higher-dimensional space. And at this point in time, this notion falls within the educated guesses. This is what the warped brane would look like if viewed from a hyperspace.\n\nIn reality, black holes are formed of warped space and warped time, which are made of components from the same brane that we are familiar with. As a result, the idea that the singularity leads to a portal, which would then enable access to hyperspace, is purely speculative.\n\nBut we're not done yet. Let's pretend that may happen, for the sake of the movie. Through this blackhole, Cooper escapes our universe brane and use it as a bridge into hyperspace. Essentially, allowing him to enter the tesseract, a chamber that extends from the singularity of the blackhole into hyperspace.\n\nFirst of all, the back face of the tesseract corresponds with Murphy‚Äôs bedroom. So everything in her bedroom, including herself, is somehow inside the tesseract‚Äôs back face. And one particular moment in time could be observed in six different viewing angles. It might come from above, while also on the right side simultaneously.\n\nThe second thing, we see that the bedroom has extrusions all around the tesseract, with two directions transverse to Cooper's chamber. Cross sections through the room that are vertical, travel upward with the passage of time. With the same notion, the cross sections that are horizontal, travel rightward as time passes. Essentially this cross section depicts a different viewing angle of Murph‚Äôs bedroom. Where the two extrusions intersect, there is a moment in the bedroom that you could observe its current ‚Äúpresent‚Äù. An actual moment of time. This is where the movie defines it as ‚Äúwhile extrusions are extending, time is flowing along them‚Äù. \n\nCooper has the ability to travel faster than the flow of time in the extrusions, allowing him to explore the tesseract complex. In summary, this weird psychedelic vortex was merely our normal spacetimebut with one temporal dimension, or time, manifested as an acessible spatial dimension. In this chamber, Cooper could simply go forward and backward in time, as simple as moving diagonally up and down through the tesseract complex. \n\n----\n\nIt‚Äôs noted from the movie that physical objects and fields having three spatial dimensions, such as humans, light, and information, cannot move backward in time. From one point in our brane to another. Just like the information about Murph in the past can go to Cooper in the tesseract in the futurebut it cannot travel back in time from Cooper to younger Murph.",
